import React from 'react'

import burgerLogo from "../../assets/images/burger-logo.png"
import styles from "./Logo.css"

export default function Logo(props) {
    return (
        <div className={styles.Logo}>
            <img src={burgerLogo}/>
        </div>
    )
}
